import './App.css';
import HomePage from './components/homePage';
import {BrowserRouter} from 'react-router-dom';
import Route from 'react-router-dom/Route';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Route path="/" render={ () => { return (<HomePage></HomePage>) }}>
        </Route>

      </div>
    </BrowserRouter>
  );
}

export default App;
